import time
a = time.time()

import numpy as np
def count(chessBoard):
	res = dict.fromkeys(range(2, len(chessBoard) + 1),  0)
	chessBoard = np.array(chessBoard)
	for i in range(len(chessBoard) - 1):
		for j in range(len(chessBoard) - 1):
			for k in range(2, len(chessBoard) - max(i, j) + 1):
				if chessBoard[i: i + k, j: j + k].sum() - k ** 2:
					break
				res[k] += 1
	return {k: v for k, v in res.items() if v}


